var Board=function(i,t){this.dimX=i,this.dimY=t;var o=[Math.floor(t/2),Math.floor(7*i/8)];this.player1=new Bike(this,o,"W");var r=[Math.floor(t/2),Math.floor(i/8)];this.player2=new Bike(this,r,"E"),this.player1.opponent=this.player2,this.player2.opponent=this.player1,this.difficulty=window.difficulty?window.difficulty:1};Board.prototype.validPosition=function(i){return i.i>=0&&i.i<this.dimY&&i.j>=0&&i.j<this.dimX};var Bike=Bike||{};